import React, { Component } from "react";
import { Link } from "react-router-dom";
import { withRouter } from "react-router";
// import { StudentExpand } from "./StudentOptions";
// import Add from "./Add";
import Delete from "./Delete";
import Edit from "./Edit";
import Select from "./Select";
import Stats from "./Stats";

const onDisplay = ({ match }, props) => {
  switch (match) {
    case "del":
      return (
        <Delete
          selectStudent={props.func.onSelectStudent}
          deleteStudent={props.func.onDeleteStudent}
          student={props.student}
        />
      );
    case "edit":
      return (
        <Edit
          selectStudent={props.func.onSelectStudent}
          editStudent={props.func.onEditStudent}
          student={props.student}
        />
      );
    case "select":
      return (
        <Select
          selectStudent={props.func.onSelectStudent}
          student={props.student}
        />
      );
    case "stats":
      return (
        <Stats
          selectStudent={props.func.onSelectStudent}
          student={props.student}
        />
      );
    default:
      return "";
  }
};

const Detail = ({ match }, props) => {
  return onDisplay(match.params.topicId, props);
};

export default Detail;
